package com.testwa.distest.client.device.listener.callback.task;import com.google.protobuf.ByteString;import com.testwa.distest.client.DeviceClient;import com.testwa.distest.client.device.driver.IDeviceRemoteControlDriver;import com.testwa.distest.client.device.listener.callback.IRemoteCommandCallBack;import lombok.extern.slf4j.Slf4j;/** * @Program: distest * @Description: * @Author: wen * @Create: 2018-05-08 16:36 **/@Slf4jpublic class JRStartCallback implements IRemoteCommandCallBack<ByteString> {    private IDeviceRemoteControlDriver client;    public JRStartCallback(IDeviceRemoteControlDriver client) {        this.client = client;    }    @Override    public void callback(ByteString bytes) {        String cmd = bytes.toStringUtf8();        client.startCompatibilityTask(cmd);    }}